import React from "react";
import "./Booking.css"

function booking(){
    return(
        <div className="booking">
            <center>
                <h3>BOOKING</h3>
                <form  className="bookform" >
                    <h2>Booking</h2>
                    <label>Event name :</label><br></br>
                    <input></input><br></br>

                </form>
            </center>

        </div>
    )
}

export default booking;
